import React from 'react';
import uniqid from "uniqid";
import {Component} from 'react';

const EducationInfo = (props) => {
  const { titles } = props;
  return (
    <ul>
       {props.titles.map((title) => {

        return <li key={uniqid()}> <a>{title.from}-{title.to} {title.titleName}, {title.school} 
        {"\n"}
        {title.moreInfo} </a> <span id={titles.indexOf(title)} onClick={props.deleteTitle}>x</span>

        </li>;

      })}
    </ul>
  );
};

export default EducationInfo;
